    TeamSettingComponent.prototype.inviteUser = function () {
        var _this = this;
        this.Message = "";
        jQuery("#btnInvite")
            .text("Please Wait...")
            .attr("disabled", true);
        jQuery("#success-addUser").addClass("hide");
        var formValue = this.inviteUserForm.value;
        if (formValue.permissions.all) {
            formValue.permissions.folder = this.foldersRef.map(function (f) { return f._id; });
        }
        var addUser = this._companyService
            .addUser(formValue, this.currentCompany.id)
            .subscribe(function (success) {
            _this.resetForm();
            jQuery("#btnInvite")
                .text("Add New User")
                .attr("disabled", false);
            ga("markettingteam.send", "event", "Dashboard", "Submit", "Dashboard User Added");
            _this.Message = "User Invited Successfully!";
            jQuery("#add-new-user").modal("hide");
            window.toastNotification(_this.Message);
            _this.closeLayover();
            _this.toggleToInvited = true;
            _this.getSelectedCompanyUsers();
        }, function (error) {
            var error_code = error.error.code;
            if (error_code === "E_UNIQUE_USERNAME_VALIDATION" ||
                error_code === "E_UNIQUE_EMAIL_VALIDATION" ||
                error_code === "E_UNIQUE_UNIDENTIFIED_VALIDATION" ||
                error_code === "E_USER_COMPANY_ALREADY_EXISTS") {
                _this.Message =
                    " This user is already a part of this company on Outgrow";
            }
            else if (error_code === "E_USER_LIMIT_EXCEEDED") {
                _this.Message =
                    "You have exceeded the user limit of you plan. Please upgrade to add more users.";
            }
            else {
                if (error.error.err_errors["emails.0.email"].Message ===
                    "Please use a valid company email address to sign up for Outgrow :)") {
                    _this.Message =
                        "You can only invite users with a valid company email address";
                }
                else {
                    _this.Message = error.error.err_errors["emails.0.email"]
                        ? error.error.err_errors["emails.0.email"].Message
                        : error.error.err_Message;
                }
            }
            jQuery("#success-addUser").removeClass("hide");
            // jQuery('#add-new-user input').val('');
            // jQuery('.name').addClass('is-empty');
            // jQuery('.email').addClass('is-empty');
            // jQuery('#btnInvite').text('Add New User');
            jQuery("#btnInvite").attr("disabled", false);
            jQuery("#dashboardAdduserMessage").html(_this.Message);
        });
    };
