    TeamSettingComponent.prototype.searchCompany = function () {
        var self = this;
        var joined = false;
        self.Message = "";
        self.searchedCompanyList = [];
        self.joinedCompanyList = [];
        if (self.joinCompanyForm.value.searchCompany.length > 2) {
            var searchCompany_1 = self._companyService
                .searchCompany(self.joinCompanyForm.value.searchCompany)
                .subscribe(function (success) {
                jQuery("#success-joinCompany").addClass("hide");
                self.searchedCompanyList = [];
                self.joinedCompanyList = [];
                self.invitedCompanyList = [];
                success.companies.forEach(function (company) {
                    joined = false;
                    for (var i = 0; i < self.myCompaniesList.length; i++) {
                        if (self.myCompaniesList[i].sub_domain === company.sub_domain) {
                            if (self.myCompaniesList[i].user_company.status ===
                                "REQUESTED" &&
                                self.myCompaniesList[i].user_company.active === false) {
                                self.joinedCompanyList.push(new _shared_models_company__WEBPACK_IMPORTED_MODULE_8__["Company"](company));
                                joined = true;
                            }
                            else if (self.myCompaniesList[i].user_company.status === "INVITED" &&
                                self.myCompaniesList[i].user_company.active === false) {
                                self.invitedCompanyList.push(new _shared_models_company__WEBPACK_IMPORTED_MODULE_8__["Company"](company));
                                joined = true;
                            }
                            break;
                        }
                    }
                    if (!joined) {
                        self.searchedCompanyList.push(new _shared_models_company__WEBPACK_IMPORTED_MODULE_8__["Company"](company));
                    }
                });
                if (self.searchedCompanyList.length === 0 &&
                    self.joinedCompanyList.length === 0 &&
                    self.invitedCompanyList.length === 0) {
                    self.Message = "No Companies Found";
                    jQuery("#success-joinCompany").removeClass("hide");
                }
            }, function (error) {
                self.Message = error.error.err_message;
                jQuery("#success-joinCompany").removeClass("hide");
                searchCompany_1.unsubscribe();
            });
        }
    };
