    TeamSettingComponent.prototype.leaveCompany = function (company, approveCount) {
        var _this = this;
        this.leaveComp = company.id;
        var self = this;
        if (self.adminCount >= 1) {
            if (approveCount > 1) {
                var leaveCompany_1 = self._companyService
                    .leaveCompany(self.leaveComp)
                    .subscribe(function (success) {
                    var filepicker_token_json = JSON.parse(self._cookieService.readCookie("filepicker_token_json"));
                    for (var i = 0; i < _this.storage.companyList.length; i++) {
                        if (_this.storage.companyList[i] === company.sub_domain)
                            break;
                    }
                    _this.storage.companyList.splice(i, 1);
                    _this.cookie = JSON.stringify(_this.storage);
                    _this._cookieService.createCookie("storage", _this.cookie, 3);
                    filepicker_token_json.splice(i, 1);
                    _this._cookieService.createCookie("filepicker_token_json", JSON.stringify(filepicker_token_json), 3);
                    self.Message = "Successfully left " + company.name;
                    window.toastNotification(self.Message);
                    //self.getMyCompanies();
                    //self.getSelectedCompanyUsers();
                    var curUrlDomain = window.location.hostname.split(".")[0];
                    //console.log('curUrlDomain',curUrlDomain, company.sub_domain);
                    var redirectDomain = "";
                    if (curUrlDomain === company.sub_domain) {
                        //console.log('if entered',self.myCompaniesList);
                        for (var i = 0; i < self.myCompaniesList.length; i++) {
                            if (curUrlDomain !== self.myCompaniesList[i].sub_domain &&
                                self.myCompaniesList[i].user_company.active) {
                                redirectDomain =
                                    self.myCompaniesList[i].sub_domain +
                                        self.subdomainExtension +
                                        "/dashboard";
                                jQuery(location).attr("href", self.protocol + redirectDomain);
                                break;
                            }
                        }
                    }
                    _this.initInviteUserForm();
                    jQuery("#leaveYes")
                        .html("Yes")
                        .attr("disabled", false);
                    jQuery("#confirmation").modal("hide");
                }, function (error) {
                    self.Message = error.error.message;
                    window.toastNotification(self.Message);
                    leaveCompany_1.unsubscribe();
                    jQuery("#leaveYes")
                        .html("Yes")
                        .attr("disabled", false);
                });
            }
            else {
                this.leaveCompanyBootbox();
                //  jQuery("#leaveConfirmation").modal("show");
            }
        }
        else {
            self.Message = "The company must have another admin!";
            window.toastNotification(self.Message);
        }
    };
